import axios from 'axios';

const pixabayClient = axios.create({
  baseURL: 'https://pixabay.com/api/',
  params: {
    key: 'YOUR_PIXABAY_API_KEY', // Reemplaza con tu API key de Pixabay
  },
});

export default pixabayClient;
